description:
Instance préparatoire pour :
- préparation du PIF du projet multifocal dans le cadre du FEM-6;
- Appui à la mise en place de la haute instance DDDGF

Présentation de deux projets : 
- Fonds Vert pour le climat (GCF) sur la thématique de gestion des ressources en eau;
- Least Developed Country Funds (LDCF) dans le domaine de la dégradation des terres
